import './Header.scss';

const Header = () => {
	return (
		<div className='Header'>
			<ul>
				<li>
					<a href=''>Home</a>
				</li>
				<li>
					<a href=''>Sign Up</a>
				</li>
				<li>
					<a href=''>Log In</a>
				</li>
			</ul>
		</div>
	);
};

export default Header;
